b02b9cfd-47e8-4bce-8e1a-00a2869b19f7	2022-02-28 21:02:52.235	regarding gmail sync (sry, don't want to post this on GH)\n\nI recently looked at a kinda similar email sync feature at work:\n• user sends a chat message (internal to our system) and the sender can choose Chat+Email\n• if chat+email, it also fires off a request to SendGrid\n• If recipient replies to SendGrid email, SendGrid will hit our webhook with the body of the email (etc) which we use to create an internal Chat object \nThe annoying thing here is that emails with quoted replies are shaped by the sender's email client. They are NOT standardized. You have to parse plain text to figure out where the new email ends and the quoted thread begins.\n\nThere are a few libraries for this and i can link em here	2021-03-15 23:49:44.028	3e43ddfb-f01a-4b98-8909-7d6ff8d97f4f	a7f9ecbb-10a0-406d-bfa6-2a75de86b5ca	18819939-db9d-43e3-8972-0d1d88cc4e8d	1615852184.028700
