d1f28bd4-0c47-4581-bc3f-aa0a0757ca7d	2022-02-28 21:02:59.863	here’s ThoughtBot’s <https://github.com/thoughtbot/email_reply_parser/blob/master/email_reply_parser.ex|entire Elixir implementation>\n\n```\ndefmodule EmailReplyParser do\n  def remove_original_email(email) do\n    email\n    |&gt; remove_quoted_email\n    |&gt; remove_trailing_newlines\n  end\n\n  defp remove_quoted_email(body) do\n    Enum.reduce(reply_header_formats(), body, fn(regex, email_body) -&gt;\n      match = Regex.split(regex, email_body)\n      List.first(match)\n    end)\n  end\n\n  defp reply_header_formats do\n    [\n      ~r/\\n\\&gt;?[[:space:]]*On.*&lt;?\\n?.*&gt;?.*\\n?wrote:\\n?/,\n    ]\n  end\n\n  defp remove_trailing_newlines(body) do\n    Regex.replace(~r/\\n+$/, body, "")\n  end\nend```	2021-03-16 00:05:14.03	3e43ddfb-f01a-4b98-8909-7d6ff8d97f4f	a7f9ecbb-10a0-406d-bfa6-2a75de86b5ca	\N	1615853114.030600
